import {useParams,Link } from "react-router-dom";
import styles from "../main.module.css"
import {useEffect, useState } from 'react';

export default function Main(){
    const userId = localStorage.getItem('userId');
    const [time,setTime] = useState(new Date());
    useEffect(()=>{
        const timeId = setInterval(()=>{
            setTime(new Date());
        },1000);
        return (()=> clearInterval(timeId));
    },[]);

    return (
        <div id={styles.main}>
            <p>{userId}님 환영합니다</p>
            <div>

                <p>{time.toLocaleDateString().split('.')[0,1]}</p>
                <ul id={styles.menu_list}>
                    <li><Link className={styles.menu} to={"/id/"+userId+"/hw_input"}>신장및 체중 변경</Link></li>
                    <li><Link className={styles.menu} to={"/id/"+userId+"/diet"}>식단기록</Link></li>
                </ul>


            </div>
            <div className="introduce">
                <p>건강 관리를 위해 <br></br>식단과 운동을 기록할 수 있는<br></br> api를 구현했습니다.</p>
            </div>

        </div>
    );
}
